/* styles */
const stylesheet = {
	body: {
		backgroundColor: '#F4EDEA',
		height: '100vh'
	},
	btnmain: {
		width: '140px',
		height: '35px',
		borderRadius: '50px',
		border: '2px solid grey',
		textAlign: 'center',
		justifyContent: 'center',
		position: 'relative',
		top: '50vh',
		left: '100vh'
	},
	homemain: {
		display: 'flex',
		overflow: 'hidden',
		color: '#12263a',
		textAlign: 'center',
		justifyContent: 'center',
		position: 'relative',
		top: '50vh'
	}

};

export default stylesheet;
